        public ChromiumWebBrowser browser { get; set; }
        public bool AddBrowser(VideoStream vs)
        {
            try
            {
                if (vs.url != null && vs.url.GetType() == typeof(String) && vs.url.ToString().Length>0)
                    browser = new ChromiumWebBrowser((String)vs.url);
                else
                    throw new Exception("Incorrect input.");

                browser.Dock = DockStyle.Fill;
                browser.BringToFront();
                this.splitContainer1.Panel1.Controls.Add(browser);

                toolStripLabel1.Text = vs.name;

                return true;
            }
            catch(Exception ex)
            {
                MessageBox.Show(ex.Message + "\n\n" + Properties.Resources.ErrorMsgBody, Properties.Resources.ErrorMsgTitle, MessageBoxButtons.OK, MessageBoxIcon.Error);
                
                return false;
            }
        }

